import React from 'react';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import styles from "./Project.module.css"

function Project() {
  const navigate = useNavigate()
  return (
    <div id="projects">
      <Link></Link>
      <button onClick={() => navigate('ecommerce')}>Ecommerce Website</button>
      <button onClick={() => navigate('twice')}>Twice Fans Page</button>
      <button onClick={() => navigate('bookkeep')}>Bookkeeping Website</button>
    </div>
  );
}

export default Project;
